<?php

function formatPhoneNumber($number) {
    // Ensure the number is a string
    $number = strval($number);
    
    // Check the length of the number
    $length = strlen($number);
    
    if ($length == 11) {
        // Insert spaces into the string
        $formatted = substr($number, 0, 4) . ' ' . substr($number, 4, 3) . ' ' . substr($number, 7, 4);
        return $formatted;
    } else {
        // If the number is not 11 digits, return it as-is or handle as needed
        return $number;
    }
}

function getMonthNow($month){
    $month = intval($month);

    switch($month){
        case"1":
            $month = "JAN";
        break;
        case"2":
            $month = "FEB";
        break;
        case"3":
            $month = "MAR";
        break;
        case"4":
            $month = "APR";
        break;
        case"5":
            $month = "MAY";
        break;
        case"6":
            $month = "JUNE";
        break;
        case"7":
            $month = "JULY";
        break;
        case"8":
            $month = "AUG";
        break;
        case"9":
            $month = "SEPT";
        break;
        case"10":
            $month = "OCT";
        break;
        case"11":
            $month = "NOV";
        break;
        case"12":
            $month = "DEC";
        break;
    }
    return $month;
}


